function LibraryPopup() {

    return (
        <>
            <h2 className="mu-page-title">팝업 (popup)</h2>
            <section className="mu-page-section">
                <p className="mu-ready-text">준비중입니다.</p>
            </section>
        </>
    );
}

export default LibraryPopup;
